import { API } from '../constant/api';
import axios from "axios";


const serviceService = async () => {
    try {
        const response = await axios.get(`${API}/categories`);

        const res = response.data;

        return res;
      } catch (errors) {
        console.error(errors);
      }

}

export default serviceService;
